import { useState } from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import Shell from './layout/Shell';
import Home from './pages/user/Home';
import Login from './pages/admin/Login';
import Dashboard from './pages/admin/Dashboard';
import SongsAdmin from './pages/admin/SongsAdmin';

const App = () => {
  const [currentTrack, setCurrentTrack] = useState(null);

  return (
    <Routes>
      <Route
        element={<Shell currentTrack={currentTrack} onSelectTrack={setCurrentTrack} />}
      >
        <Route index element={<Home onSelectTrack={setCurrentTrack} />} />
        <Route path="/admin" element={<Dashboard />} />
        <Route path="/admin/songs" element={<SongsAdmin onSelectTrack={setCurrentTrack} />} />
      </Route>
      <Route path="/login" element={<Login />} />
      <Route path="*" element={<Navigate to="/" replace />} />
    </Routes>
  );
};

export default App;
